import React, { Component } from 'react';

class Listas extends Component {
  constructor(props) {
    super(props);
    this.state = {
      feed: [
        { id: 1, username: 'Ricardo', curtidas: 10, comentarios: 2 },
        { id: 1, username: 'Luca', curtidas: 10, comentarios: 2 },
        { id: 1, username: 'Nicholas', curtidas: 10, comentarios: 2 },
        { id: 1, username: 'Matteo', curtidas: 10, comentarios: 2 },
        { id: 1, username: 'Barbara', curtidas: 10, comentarios: 2 },
        { id: 1, username: 'Aurelia', curtidas: 10, comentarios: 2 },
        { id: 1, username: 'Nico', curtidas: 10, comentarios: 2 },
      ],
    };
  }
  render() {
    return (
      <div>
        <div>hello hello</div>
        <div>
          {this.state.feed.map(item => {
            return (
              <div className="App">
                <h3>Usuario: {item.username}</h3>
                <p>Tem {item.curtidas} curtidas</p>
                <p>Tem {item.comentarios} comentarios</p>
              </div>
            );
          })}
        </div>
      </div>
    );
  }
}

export default Listas;
